import ExpandableMenu from '../expandableMenu';
import ExpandableSearch from '../expandableSearch';

import style from './stylesheet';

const HeaderMenu = ({
    image,
    searchValue,
    onChageSearchText
}) => {
    return <div className="headerContainer">
        <img
            src={image.url}
            width={image.width}
            height={image.height ? image.height : "auto"}
        />
        <ExpandableMenu

        />
        <ExpandableSearch
            value={searchValue}
            onChange={onChageSearchText}
            placegolder="Enter movie name here"
        />
        <style jsx>{`
    .headerContainer {
        width: 100%;
        display: flex;
        flex-direction: row;
        padding: 10px;
    }
`}</style>
    </div>
};
export default HeaderMenu;
